import * as React from 'react';
import styled from "styled-components";

const StyledSelect = styled.select`
    font-size: larger;
    border: 1px solid #ccc;
    box-sizing: border-box;
    padding: 12px 20px;
    display: inline-block;
    color: grey;
    background: none;
`;
const StyledOption = styled.option``;


export interface DropDownProps {

}

const options = [
    {
        id: '1', option: 'user'
    },
    {
        id: '2', option: 'repo'
    }]

const DropDown: React.SFC<DropDownProps> = () => {
    return (<StyledSelect name="cars" id="cars">
        {options.map(o => <StyledOption value={o.option}> {o.option}</StyledOption>)}
        <StyledOption value="volvo">Volvo</StyledOption>
        <StyledOption value="saab">Saab</StyledOption>
        <StyledOption value="mercedes">Mercedes</StyledOption>
        <StyledOption value="audi">Audi</StyledOption>
    </StyledSelect>);
}

export default DropDown;
